tive\":false,\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":8,\"quote_count\":1},\"conversation_id\":\"1400182101551484928\",\"author_id\":\"2357304633\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T19:50:43.000Z\",\"text\":\"On international sex workers day I want to thank all the sex workers whose work pushed me to be decarceral and ultimately an abolitionist!\\n\\nMay all of us continue to stand in solidarity and act in solidarity with you.\",\"id\":\"1400178083290877960\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":60,\"reply_count\":0,\"like_count\":137,\"quote_count\":0},\"conversation_id\":\"1400178083290877960\",\"author_id\":\"1170413173515702273\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T01:40:35.000Z\",\"text\":\"On this day in “F*ck Around and Find Out” History... https://t.co/rlWEXOgpBh\",\"entities\":{\"urls\":[{\"start\":53,\"end\":76,\"url\":\"https://t.co/rlWEXOgpBh\",\"expanded_url\":\"https://twitter.com/DrRDB/status/1399903740375617538/photo/1\",\"display_url\":\"pic.twitter.com/rlWEXOgpBh\"}]},\"id\":\"1399903740375617538\",\"attachments\":{\"media_keys\":[\"3_1399903737989107714\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":7680,\"reply_count\":106,\"like_count\":35777,\"quote_count\":351},\"conversation_id\":\"1399903740375617538\",\"author_id\":\"13906752\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T19:36:14.000Z\",\"text\":\"The arrest of the 21 LGBT+ activists in Ho is reminiscent of the state's dedication to violating the freedoms of LGBT+ people. \\n\\nIt's important now more than ever to bring attention to how this affects queer people across the country.\\n\\nJoin us for these conversations. \\uD83C\\uDDEC\\uD83C\\uDDED \\uD83C\\uDFF3️‍\\uD83C\\uDF08 https://t.co/gXnCRQ6RSq\",\"entities\":{\"urls\":[{\"start\":277,\"end\":300,\"url\":\"https://t.co/gXnCRQ6RSq\",\"expanded_url\":\"https://twitter.com/MsLadyPhyll/status/1400174436884566017/photo/1\",\"display_url\":\"pic.twitter.com/gXnCRQ6RSq\"}],\"annotations\":[{\"start\":40,\"end\":41,\"probability\":0.82,\"type\":\"Place\",\"normalized_text\":\"Ho\"}]},\"id\":\"1400174436884566017\",\"attachments\":{\"media_keys\":[\"16_1400174429901049860\"]},\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400174085724852229\"}],\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":32,\"quote_count\":0},\"conversation_id\":\"1400174085724852229\",\"author_id\":\"215779616\",\"in_reply_to_user_id\":\"215779616\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T19:34:50.000Z\",\"text\":\"We view pride as a celebration and a protest. \\uD83C\\uDF89\u270a\\uD83C\\uDFFF \\n\\nA celebration of queer and trans people and a protest against the injustices LGBT+ people face in Ghana, Africa &amp; beyond.\\uD83C\\uDFF3️‍\\uD83C\\uDF08 \\uD83C\\uDDEC\\uD83C\\uDDED \\n\\nWe will be using these hashtags for Pride\\n#GhPride2021 \\n#ReleaseAllThe21 #QueerGhanaianLivesMatter https://t.co/TG99HZfWZ4\",\"entities\":{\"urls\":[{\"start\":286,\"end\":309,\"url\":\"https://t.co/TG99HZfWZ4\",\"expanded_url\":\"https://twitter.com/MsLadyPhyll/status/1400174085724852229/photo/1\",\"display_url\":\"pic.twitter.com/TG99HZfWZ4\"}],\"annotations\":[{\"start\":152,\"end\":156,\"probability\":0.9954,\"type\":\"Place\",\"normalized_text\":\"Ghana\"},{\"start\":159,\"end\":164,\"probability\":0.6284,\"type\":\"Place\",\"normalized_text\":\"Africa\"}],\"hashtags\":[{\"start\":229,\"end\":241,\"tag\":\"GhPride2021\"},{\"start\":243,\"end\":259,\"tag\":\"ReleaseAllThe21\"},{\"start\":260,\"end\":285,\"tag\":\"QueerGhanaianLivesMatter\"}]},\"id\":\"1400174085724852229\",\"attachments\":{\"media_keys\":[\"3_1400174079253135366\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":68,\"reply_count\":6,\"like_count\":174,\"quote_count\":1},\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}}],\"conversation_id\":\"1400174085724852229\",\"author_id\":\"215779616\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T14:56:03.000Z\",\"text\":\"A lot of leftists in imperialist countries don't understand that people in the global south are not fighting against \\\"the state\\\" or \\\"hierarchy\\\" in the abstract. They're fighting against the US and its allies. If you wanna be in solidarity with them, fight your own government.\",\"id\":\"1400103926028963840\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":1039,\"reply_count\":22,\"like_count\":4816,\"quote_count\":37},\"conversation_id\":\"1400103926028963840\",\"author_id\":\"1218926786727305222\",\"entities\":{\"annotations\":[{\"start\":190,\"end\":191,\"probability\":0.9572,\"type\":\"Place\",\"normalized_text\":\"US\"}]},\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-01T20:48:47.000Z\",\"text\":\"Important new book from my fellow series editor \u2066@Boydell_Africa\u2069 https://t.co/c31egv5mWz\",\"entities\":{\"urls\":[{\"start\":66,\"end\":89,\"url\":\"https://t.co/c31egv5mWz\",\"expanded_url\":\"https://twitter.com/EmmaWildWood1/status/1399830309307305992/photo/1\",\"display_url\":\"pic.twitter.com/c31egv5mWz\"}],\"mentions\":[{\"start\":49,\"end\":64,\"username\":\"Boydell_Africa\"}]},\"id\":\"1399830309307305992\",\"attachments\":{\"media_keys\":[\"3_1399830299576569862\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":34,\"reply_count\":1,\"like_count\":154,\"quote_count\":3},\"conversation_id\":\"1399830309307305992\",\"author_id\":\"1132663111192842240\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T18:07:47.000Z\",\"text\":\"