-02T16:47:44.000Z\",\"text\":\"This has definitely been one of my favorite projects and i’m so excited to share. Join Black Popular Culture III (2pm EST) to hear me talk about how Disney presents ‘Blackness’ as genre. #pcaaca21 @pcaaca https://t.co/4U5DkEoxqz\",\"entities\":{\"urls\":[{\"start\":205,\"end\":228,\"url\":\"https://t.co/4U5DkEoxqz\",\"expanded_url\":\"https://twitter.com/eva__co/status/1400132033763065856/photo/1\",\"display_url\":\"pic.twitter.com/4U5DkEoxqz\"}],\"annotations\":[{\"start\":87,\"end\":111,\"probability\":0.7716,\"type\":\"Other\",\"normalized_text\":\"Black Popular Culture III\"},{\"start\":149,\"end\":154,\"probability\":0.4722,\"type\":\"Organization\",\"normalized_text\":\"Disney\"}],\"mentions\":[{\"start\":197,\"end\":204,\"username\":\"pcaaca\"}],\"hashtags\":[{\"start\":187,\"end\":196,\"tag\":\"pcaaca21\"}]},\"id\":\"1400132033763065856\",\"attachments\":{\"media_keys\":[\"3_1400132029535207436\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":9,\"reply_count\":10,\"like_count\":42,\"quote_count\":3},\"context_annotations\":[{\"domain\":{\"id\":\"45\",\"name\":\"Brand Vertical\",\"description\":\"Top level entities that describe a Brands industry\"},\"entity\":{\"id\":\"781974597310615553\",\"name\":\"Entertainment\"}},{\"domain\":{\"id\":\"46\",\"name\":\"Brand Category\",\"description\":\"Categories within Brand Verticals that narrow down the scope of Brands\"},\"entity\":{\"id\":\"781974597105094656\",\"name\":\"TV/Movies Related\"}},{\"domain\":{\"id\":\"47\",\"name\":\"Brand\",\"description\":\"Brands and Companies\"},\"entity\":{\"id\":\"10037284711\",\"name\":\"Disney\"}}],\"conversation_id\":\"1400132033763065856\",\"author_id\":\"826650721542082560\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T18:08:55.000Z\",\"text\":\"You can share your own stories to the hashtag #GhPride2021 or visit @smajority website to tell us more about what these narratives of family acceptance mean to you \\uD83D\\uDC47\\uD83C\\uDFFF https://t.co/Yqp5FzQvfI\",\"entities\":{\"urls\":[{\"start\":167,\"end\":190,\"url\":\"https://t.co/Yqp5FzQvfI\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\",\"status\":200,\"title\":\"Family Acceptance Week — Silent Majority, Ghana\",\"unwound_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\"}],\"mentions\":[{\"start\":68,\"end\":78,\"username\":\"SMajority\"}],\"hashtags\":[{\"start\":46,\"end\":58,\"tag\":\"GhPride2021\"}]},\"id\":\"1400152461453692929\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110063059079172\"}],\"public_metrics\":{\"retweet_count\":5,\"reply_count\":0,\"like_count\":2,\"quote_count\":0},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:20:26.000Z\",\"text\":\"Visit our website for all the programs we have scheduled for this week\\n\\nhttps://t.co/Yqp5FzQvfI\",\"entities\":{\"urls\":[{\"start\":72,\"end\":95,\"url\":\"https://t.co/Yqp5FzQvfI\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\"}]},\"id\":\"1400110063059079172\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110062178390016\"}],\"public_metrics\":{\"retweet_count\":7,\"reply_count\":1,\"like_count\":5,\"quote_count\":0},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:20:26.000Z\",\"text\":\"...being unlawfully held in Ho Prisons, the repeal of Ghana’s Section 104, and the government’s fulfillment of our constitutionally mandated protections #releaseallthe21 \\n#QueerGhanaianLivesMatter\\n#GHPride2021\",\"id\":\"1400110062178390016\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110061293346816\"}],\"public_metrics\":{\"retweet_count\":8,\"reply_count\":1,\"like_count\":8,\"quote_count\":0},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"entities\":{\"annotations\":[{\"start\":28,\"end\":37,\"probability\":0.5896,\"type\":\"Place\",\"normalized_text\":\"Ho Prisons\"},{\"start\":54,\"end\":58,\"probability\":0.9609,\"type\":\"Place\",\"normalized_text\":\"Ghana\"}],\"hashtags\":[{\"start\":153,\"end\":169,\"tag\":\"releaseallthe21\"},{\"start\":171,\"end\":196,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":197,\"end\":209,\"tag\":\"GHPride2021\"}]},\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:20:26.000Z\",\"text\":\"As we celebrate the love and repair that comes through family acceptance, we remain firm in our fight for absolute social inclusion, which includes our demands for the immediate release of all 21 activists...\\n\\n#ReleaseAllthe21\\n#QueerGhanaianLivesMatter\\n#GHPride2021\",\"id\":\"1400110061293346816\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110059447783430\"}],\"public_metrics\":{\"retweet_count\":9,\"reply_count\":1,\"like_count\":8,\"quote_count\":1},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"entities\":{\"hashtags\":[{\"start\":210,\"end\":226,\"tag\":\"ReleaseAllthe21\"},{\"start\":227,\"end\":252,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":253,\"end\":265,\"tag\":\"GHPride2021\"}]},\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:20:25.000Z\",\"text\":\"Our hope is that for those navigating the pain of rejection, you may see possibilities for something better; for those  on that bumpy road towards acceptance, it smooths out; and for those who have chosen not to take this path, to know that their choices are equally valid.\",\"id\":\"1400110059447783430\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110057870737409\"}],\"public_metrics\":{\"retweet_count\":8,\"reply_count\":1,\"like_count\":6,\"quote_count\":0},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:20:25.000Z\",\"text\":\"The prevailing narratives about queer and trans* Ghanaians is one of family and social rejection. Yet there’s more to our stories.\\n\\nCheck out our SM pages &amp; website for narratives about the journey towards family acceptance.\\n#QueerGhanaianLivesMatter\\n#GhPride2021\\n#ReleaseAllthe21 https://t.co/dAPvl8ZwRd\",\"entities\":{\"urls\":[{\"start\":285,\"end\":308,\"url\":\"https://t.co/dAPvl8ZwRd\",\"expanded_url\":\"https://twitter.com/smajoritygh/status/1400110057870737409/video/1\",\"display_url\":\"pic.twitter.com/dAPvl8ZwRd\"}],\"hashtags\":[{\"start\":229,\"end\":254,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":255,\"end\":267,\"tag\":\"GhPride2021\"},{\"start\":268,\"end\":284,\"tag\":\"ReleaseAllthe21\"}]},\"id\":\"1400110057870737409\",\"attachments\":{\"media_keys\":[\"7_1400108397136158721\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":50,\"reply_count\":1,\"like_count\":80,\"quote_count\":4},\"conversation_id\":\"1400110057870737409\",\"author_id\":\"1365695747052691456\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T18:03:08.000Z\",\"text\":\"We support sex workers, especially Black sex workers. We stand in solidarity with Black sex workers in Africa &amp; in the African Diaspora. \u2728\\n\\nToday &amp; everyday, support Black sex worke