],\"annotations\":[{\"start\":54,\"end\":55,\"probability\":0.4505,\"type\":\"Organization\",\"normalized_text\":\"Ph\"},{\"start\":116,\"end\":125,\"probability\":0.8802,\"type\":\"Place\",\"normalized_text\":\"IIT Mumbai\"}]},\"id\":\"1400122263073034244\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1400108672588476425\"}],\"public_metrics\":{\"retweet_count\":10,\"reply_count\":2,\"like_count\":63,\"quote_count\":0},\"conversation_id\":\"1400122263073034244\",\"author_id\":\"759050322593456128\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T16:00:41.000Z\",\"text\":\"“SARS has mutated into a mirror image of the forces it was designed to fight... this unit arbitrarily arrests people for... driving “flashy” cars, or merely looking different in a way that deviates from approved norms or gender expressions within society” https://t.co/QEuKUMkvC7\",\"entities\":{\"urls\":[{\"start\":256,\"end\":279,\"url\":\"https://t.co/QEuKUMkvC7\",\"expanded_url\":\"https://www.wearyourvoicemag.com/queer-nigerian-youths-endsars-is-a-fight-against-police-brutality-homophobia/\",\"display_url\":\"wearyourvoicemag.com/queer-nigerian…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1404906669398708227/0iMtPtnE?format=png&name=orig\",\"width\":800,\"height\":399},{\"url\":\"https://pbs.twimg.com/news_img/1404906669398708227/0iMtPtnE?format=png&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"For Queer Nigerian Youths, #ENDSARS Is A Fight Against Police Brutality And Homophobia\",\"description\":\"The many arbitrary SARS arrests and harassment of queer Nigerian youth confirm bias towards and targeting of the queer community in Nigeria’s police system.\",\"unwound_url\":\"https://www.wearyourvoicemag.com/queer-nigerian-youths-endsars-is-a-fight-against-police-brutality-homophobia/\"}],\"annotations\":[{\"start\":1,\"end\":4,\"probability\":0.7845,\"type\":\"Organization\",\"normalized_t