fm\"}]},\"in_reply_to_user_id\":\"460255655\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:28:20.000Z\",\"text\":\"Apparently it’s rude to call khebab sellers abochi \\uD83D\\uDE2D\\uD83D\\uDE2D\",\"id\":\"1400112051494731779\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":3,\"reply_count\":4,\"like_count\":4,\"quote_count\":7},\"conversation_id\":\"1400112051494731779\",\"author_id\":\"454941248\",\"source\":\"Twitter for iPhone\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T15:29:15.000Z\",\"text\":\"The prevailing narratives about queer and trans* Ghanaians is one of family and social rejection. Yet there’s more to our stories.\\n\\nCheck out @smajoritygh &amp; website for narratives about the journey towards family acceptance.\\n#QueerGhanaianLivesMatter\\n#GhPride2021\\n#ReleaseAllthe21 https://t.co/wdhXFfaxOm\",\"entities\":{\"urls\":[{\"start\":285,\"end\":308,\"url\":\"https://t.co/wdhXFfaxOm\",\"expanded_url\":\"https://twitter.com/wunpini_fm/status/1400112283968229378/video/1\",\"display_url\":\"pic.twitter.com/wdhXFfaxOm\"}],\"mentions\":[{\"start\":142,\"end\":154,\"username\":\"smajoritygh\"}],\"hashtags\":[{\"start\":229,\"end\":254,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":255,\"end\":267,\"tag\":\"GhPride2021\"},{\"start\":268,\"end\":284,\"tag\":\"ReleaseAllthe21\"}]},\"id\":\"1400112283968229378\",\"attachments\":{\"media_keys\":[\"7_1400111752390578177\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":19,\"reply_count\":1,\"like_count\":24,\"quote_count\":0},\"conversation_id\":\"1400112283968229378\",\"author_id\":\"460255655\",\"source\":\"Twitter Web App\"},{\"lang\":\"en\",\"created_at\":\"2021-06-01T13:34:49.000Z\",\"text\":\"It's day 1 of pride month and the 21 LGBT activists arrested are still being held in Ho. \\n\\nThe @NAkufoAddo led govt has shown us over and over again that human rights do not matter in Ghana. \\n\\nThe rights of LGBT continue to be violated. We demand their release. #ReleaseThe21 https://t.co/o2aFyTaV0V\",\"entities\":{\"urls\":[{\"start\":276,\"end\":299,\"url\":\"https://t.co/o2aFyTaV0V\",\"expanded_url\":\"https://twitter.com/wunpini_fm/status/1399721097138999302/photo/1\",\"display_url\":\"pic.twitter.com/o2aFyTaV0V\"},{\"start\":276,\"end\":299,\"url\":\"https://t.co/o2aFyTaV0V\",\"expanded_url\":\"https://twitter.com/wunpini_fm/status/1399721097138999302/photo/1\",\"display_url\":\"pic.twitter.com/o2aFyTaV0V\"}],\"annotations\":[{\"start\":85,\"end\":86,\"probability\":0.6923,\"type\":\"Place\",\"normalized_text\":\"Ho\"},{\"start\":184,\"end\":188,\"probability\":0.9813,\"type\":\"Place\",\"normalized_text\":\"Ghana\"}],\"mentions\":[{\"start\":95,\"end\":106,\"username\":\"NAkufoAddo\"}],\"hashtags\":[{\"start\":262,\"end\":275,\"tag\":\"ReleaseThe21\"}]},\"id\":\"1399721097138999302\",\"attachments\":{\"media_keys\":[\"3_1399721092281929740\",\"3_1399721094777651216\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":95,\"reply_count\":1,\"like_count\":72,\"quote_count\":1},\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}},{\"domain\":{\"id\":\"10\",\"name\":\"Person\",\"description\":\"Named people in the world like Nelson Mandela\"},\"entity\":{\"id\":\"899715908754563072\",\"name\":\"Nana Akufo Addo\",\"description\":\"President of Ghana\"}},{\"domain\":{\"id\":\"35\",\"name\":\"Politician\",\"description\":\"Politicians in the world, like Joe Biden\"},\"entity\":{\"id\":\"899715908754563072\",\"name\":\"Nana Akufo Addo\",\"description\":\"President of Ghana\"}}],\"conversation_id\":\"1399721097138999302\",\"author_id\":\"460255655\",\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T11:57:57.000Z\",\"text\":\"At @smajoritygh we view pride as a celebration &amp; a protest. \\uD83C\\uDF89\u270a\\uD83C\\uDFFF \\n\\nA celebration of queer &amp; trans people &amp; a protest against the injustices LGBT+ people face in Ghana, Africa &amp; beyond.\\uD83C\\uDFF3️‍\\uD83C\\uDF08 \\uD83C\\uDDEC\\uD83C\\uDDED \\n\\nJoin the conversation! \\n#GhPride2021 \\n#ReleaseAllThe21 #QueerGhanaianLivesMatter https://t.co/RT3CM1Sarq\",\"entities\":{\"urls\":[{\"start\":290,\"end\":313,\"url\":\"https://t.co/RT3CM1Sarq\",\"expanded_url\":\"https://twitter.com/wunpini_fm/status/1400059107051192331/photo/1\",\"display_url\":\"pic.twitter.com/RT3CM1Sarq\"}],\"annotations\":[{\"start\":162,\"end\":166,\"probability\":0.9956,\"type\":\"Place\",\"normalized_text\":\"Ghana\"},{\"start\":169,\"end\":174,\"probability\":0.6224,\"type\":\"Place\",\"normalized_text\":\"Africa\"}],\"mentions\":[{\"start\":3,\"end\":15,\"username\":\"smajoritygh\"}],\"hashtags\":[{\"start\":233,\"end\":245,\"tag\":\"GhPride2021\"},{\"start\":247,\"end\":263,\"tag\":\"ReleaseAllThe21\"},{\"start\":264,\"end\":289,\"tag\":\"QueerGhanaianLivesMatter\"}]},\"id\":\"1400059107051192331\",\"attachments\":{\"media_keys\":[\"3_1400059105025441794\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":70,\"reply_count\":1,\"like_count\":132,\"quote_count\":0},\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}}],\"conversation_id\":\"1400059107051192331\",\"author_id\":\"460255655\",\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T14:00:51.000Z\",\"text\":\"“Voices of solidarity from the diaspora are especially important right now. Ghana’s government continues to court Africans in the diaspora, and a principled stance from this demographic against state repression can challenge the government’s position.”\\nhttps://t.co/p65UTQ23NE\",\"entities\":{\"urls\":[{\"start\":253,\"end\":276,\"url\":\"https://t.co/p65UTQ23NE\",\"expanded_url\":\"https://www.wearyourvoicemag.com/the-institutionalized-repression-of-queer-and-transgender-rights-in-ghana/\",\"display_url\":\"wearyourvoicemag.com/the-institutio…\"}],\"annotations\":[{\"start\":76,\"end\":80,\"probability\":0.9413,\"type\":\"Place\",\"normalized_text\":\"Ghana\"}]},\"id\":\"1400090035030986756\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":8,\"reply_count\":0,\"like_count\":12,\"quote_count\":0},\"conversation_id\":\"1400090035030986756\",\"author_id\":\"2279883714\",\"source\":\"Hootsuite Inc.\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T11:51:02.000Z\",\"text\":\"The arrest of the 21 LGBT+ activists in Ho is reminiscent of the state's dedication to violating the freedoms of LGBT+ people. \\n\\nIt's important now more than ever to bring attention to how this affects queer people across the country.\\n\\nJoin us for these conversations. \\uD83C\\uDDEC\\uD83C\\uDDED \\uD83C\\uDFF3️‍\\uD83C\\uDF08\",\"id\":\"1400057364582178819\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400057362480832512\"}],\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":11,\"quote_count\":0},\"conversation_id\":\"1400057362480832512\",\"author_id\":\"1365695747052691456\",\"entities\":{\"annotations\":[{\"start\":40,\"end\":41,\"probability\":0.8183,\"type\":\"Place\",\"normalized_text\":\"Ho\"}]},\"in_reply_to_user_id\":\"1365695747052691456\",\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T11:51:01.000Z\",\"text\":\"We view pride as a celebration and a protest. \\uD83C\\uDF89\u270a\\uD83C\\uDFFF \\n\\nA celebration of queer and trans people and a protest against the injustices LGBT+ people face in Ghana, Africa &amp; beyond.\\uD83C\\uDFF3️‍\\uD83C\\uDF08 \\uD83C\\uDDEC\\uD83C\\uDDED \\n\\nWe will be using these hashtags for Pride\\n#GhPride2021 \\n#ReleaseAllThe21 #QueerGhanaianLivesMatter https://t.co/sHycn7f7D5\",\"entities\":{\"urls\":[{\"start\":286,\"end\":309,\"url\":\"https://t.co/sHycn7f7D5\",\"expanded_url\":\"https://twitter.com/smajoritygh/status/1400057362480832512/photo/1\",\"display_url\":\"pic.twitter.com/sHycn7f7D5\"}],\"annotations\":[{\"start\":152,\"end\":156,\"probability\":0.9954,\"type\":\"Place\",\"normalized_text\":\"Ghana\"},{\"start\":159,\"end\":164,\"probability\":0.6284,\"type\":\"Place\",\"normalized_text\":\"Africa\"}],\"hashtags\":[{\"start\":229,\"end\":241,\"tag\":\"GhPride2021\"},{\"start\":243,\"end\":259,\"tag\":\"ReleaseAllThe21\"},{\"start\":260,\"end\":285,\"tag\":\"QueerGhanaianLivesMatter\"}]},\"id\":\"1400057362480832512\",\"attachments\":{\"media_keys\":[\"3_1400057359968395267\"]},\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":32,\"reply_count\":1,\"like_count\":41,\"quote_count\":2},\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}}],\"conversation_id\":\"1400057362480832512\",\"author_id\":\"1365695747052691456\",\"source\":\"Twitter for Android\"},{\"lang\":\"en\",\"created_at\":\"2021-06-02T13:11:10.000Z\",\"text\":\"As you already know, we have planned Pride month around weekly themes.\\n\\nThis week we will be sharing with you narratives about family acceptance in the Ghanaian LGBT+ community.\\n\\n\\uD83D\\uDC47\\uD83C\\uDFFFhttps://t.co/Yqp5FzQvfI\\n\\n More coming...\\n#GhPride2021 \\n#ReleaseAllThe21 \\n#QueerGhanaianLivesMatter https://t.co/VNOnmtR3sJ\",\"entities\":{\"urls\":[{\"start\":181,\"end\":204,\"url\":\"https://t.co/Yqp5FzQvfI\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\"},{\"start\":280,\"end\":303,\"url\":\"https://t.co/VNOnmtR3sJ\",\"expanded_url\":\"https://twitter.com/smajoritygh/status/1400077530904805378/photo/1\",\"d